import React from "react";
import SideBar from "../components/SideBar";
import "../globals.css"; 

const MainPage = () => {

      return (
        <div className="container">
          <div className="sidebar">
          <SideBar/>
          </div>
          <div className="main-content">
          <p>This project has been created with the inspiration of the work of SquirrelPlays.
            The two views used in the game are created by him.
            I rework his table of characteristics and the way of calculating score.
            Rest of the project is mine.
            Major improvement, I created a first version of generation of the best 11, with a formation and chosen roles.
        </p>
          </div>
        </div>
      )
    }

export default MainPage;
